      <Card.Body>
        <Link to={`product/${product._id}`}>
          <Card.Title as='div'>
            <strong>{product.name}</strong>
          </Card.Title>
        </Link>
        <Card.Text as='div'>
          <h1>achyuth</h1>
        </Card.Text>
        <Card.Text as='div'> &#x20B9; {product.price}</Card.Text>
      </Card.Body>
    </Card>

